impl Solution {
    pub fn minimum_beautiful_substrings(s: String) -> i32 {
        let mut dp = vec![-1; s.len() + 1];
        dp[0] = 0;
        let powers_of_5: Vec<u64> = (0..)
            .map(|x| 5u64.pow(x))
            .take_while(|&x| x <= 1 << s.len())
            .collect();
        for i in 1..=s.len() {
            if s.as_bytes()[i - 1] == b'0' {
                continue;
            }
            let mut num = 0u64;
            for j in (0..i).rev() {
                num >>= 1;
                num |= (s.as_bytes()[j] - b'0') as u64 * (1 << (i - j - 1));
                if powers_of_5.contains(&num) {
                    if dp[j] != -1 {
                        if dp[i] == -1 {
                            dp[i] = dp[j] + 1;
                        } else {
                            dp[i] = dp[i].min(dp[j] + 1);
                        }
                    }
                }
            }
        }
        dp[s.len()]
    }
}
